+ (void)drawCanvas2
{
    //// General Declarations
    CGContextRef context = UIGraphicsGetCurrentContext();

    //// Color Declarations
    UIColor* filterBarGradientStop = [UIColor colorWithRed: 0 green: 0 blue: 0 alpha: 0];
    UIColor* filterBarGradientColor = [UIColor colorWithRed: 0.094 green: 0.094 blue: 0.094 alpha: 0.472];

    //// Gradient Declarations
    CGFloat filterBarGradientLocations[] = {0, 0.31, 0.69};
    PCGradient* filterBarGradient = [PCGradient gradientWithColors: @[filterBarGradientColor, [filterBarGradientColor blendedColorWithFraction: 0.5 ofColor: filterBarGradientStop], filterBarGradientStop] locations: filterBarGradientLocations];

    //// Rectangle Drawing
    UIBezierPath* rectanglePath = [UIBezierPath bezierPathWithRect: CGRectMake(0, 0, 103, 64)];
    CGContextSaveGState(context);
    [rectanglePath addClip];
    CGContextDrawLinearGradient(context, filterBarGradient.CGGradient, CGPointMake(0, 32), CGPointMake(103, 32), 0);
    CGContextRestoreGState(context);


    //// Rectangle 2 Drawing
    CGContextSaveGState(context);
    CGContextTranslateCTM(context, 206, 64);
    CGContextRotateCTM(context, -180 * M_PI / 180);

    UIBezierPath* rectangle2Path = [UIBezierPath bezierPathWithRect: CGRectMake(0, 0, 103, 64)];
    CGContextSaveGState(context);
    [rectangle2Path addClip];
    CGContextDrawLinearGradient(context, filterBarGradient.CGGradient, CGPointMake(0, 32), CGPointMake(103, 32), 0);
    CGContextRestoreGState(context);

    CGContextRestoreGState(context);
}

+ (void)drawSidebarMenuBackgroundImage
{

    //// Rectangle Drawing
    UIBezierPath* rectanglePath = [UIBezierPath bezierPathWithRect: CGRectMake(0, 0, 50, 50)];
    [PvmntStyleKit.mainSidebarMenu setFill];
    [rectanglePath fill];
}

